import React, {Component} from "react";

class Clock extends Component{
    render(){
        var now_time = new Date();

        return(
        <nav>
            <div>{now_time.getHours()+ ":"+ now_time.getMinutes() + ":"+ now_time.getSeconds()}</div>
        </nav>
        );
    }
}

export default Clock;
